SET IDENTITY_INSERT [SysSubDistrict] ON;
GO
MERGE INTO [SysSubDistrict] AS trg USING (
	SELECT
		[SubDistrictId],
		[SubDistrictCode],
		[SubDistrictNameTH],
		[SubDistrictNameEN],
		[DistrictId],
		[Postcode]
	FROM [tmp_SysSubDistrict]) AS src
ON trg.[SubDistrictId] = src.[SubDistrictId]
WHEN NOT MATCHED THEN
	
INSERT ([SubDistrictId], [SubDistrictCode], [SubDistrictNameTH], [SubDistrictNameEN], [DistrictId], [Postcode])
	VALUES (src.[SubDistrictId], src.[SubDistrictCode], src.[SubDistrictNameTH], src.[SubDistrictNameEN], src.[DistrictId], src.[Postcode])
WHEN MATCHED THEN
	UPDATE SET
		trg.[SubDistrictCode] = src.[SubDistrictCode],
		trg.[SubDistrictNameTH] = src.[SubDistrictNameTH],
		trg.[SubDistrictNameEN] = src.[SubDistrictNameEN],
		trg.[DistrictId] = src.[DistrictId],
		trg.[Postcode] = src.[Postcode];
GO
SET IDENTITY_INSERT [SysSubDistrict] OFF;
GO
DROP TABLE [tmp_SysSubDistrict];
GO